import React, { useState, useEffect } from 'react';
import { getBooks } from '../lib/apiServices';

const BookList = () => {
  getBooks().then((res) => {
    const listBooks = res.data;
  });
  return (
    <div>
      <h1>{listBooks}</h1>
    </div>
  );
};
export default BookList;
